//Affiche et zoom, dzoom sur l'image
function afficheZoomImg(){
    //Cration de l'image
    var image = document.createElement('img');
    var imageSmall = document.createElement('img');
    var divImage = document.querySelector('.divImage');
    var imageSrc = 'data:image/png;base64,' + base64String;
    image.src = imageSrc;
    imageSmall.src = imageSrc;
    divImage.appendChild(image);
    birdView.appendChild(imageSmall);

    /////////////////////////////////////
    //Fonctionnalit de zoom dans l'image
    ////////////////////////////////////
    var zoomScale = 1;
    var brightness = 100;
    var contrast = 100;
    let pos = { top: 0, left: 0, x: 0, y: 0 };

    const mouseDownHandler = function (e) {
        pos = {
            left: divImage.scrollLeft,
            top: divImage.scrollTop,
            // position actuel du curseur
            x: e.clientX,
            y: e.clientY,
        };

        document.addEventListener('mousemove', mouseMoveHandler);
        document.addEventListener('mouseup', mouseUpHandler);
    };
    const mouseMoveHandler = function (e) {
        // distance entre curseur et dplacement
        const dx = e.clientX - pos.x;
        const dy = e.clientY - pos.y;

        // Scroller divImage vers la nouvelle position
        divImage.scrollTop = pos.top - dy;
        divImage.scrollLeft = pos.left - dx;
    };

    const mouseUpHandler = function () {
        divImage.style.cursor = 'grab';

        document.removeEventListener('mousemove', mouseMoveHandler);
        document.removeEventListener('mouseup', mouseUpHandler);
    };
    divImage.addEventListener('mousedown', mouseDownHandler);


    //Ecouteur d'venements pour les boutons de zoom
    zoomBtn.addEventListener('click', function(){
        if(zoomScale < 15){
            zoomScale++;
            //image.style.scale = zoomScale;
            image.style.cssText = "transform : scale("+ zoomScale +"); "
        }
    });
    dezoomBtn.addEventListener('click', function(){
        if(zoomScale > 1){
            zoomScale--;
            //image.style.scale = zoomScale;
            image.style.cssText = "transform : scale("+ zoomScale +"); "
        }
    });

    // Ecouteur d'venements pour les boutons de luminosit
    brightnessPlusBtn.addEventListener('click', function(){
        brightness = brightness + 50;
        image.style.filter = `brightness(${brightness}%)`;
    });
    brightnessMoinsBtn.addEventListener('click', function(){
        brightness = brightness - 50;
        image.style.filter = `brightness(${brightness}%)`;
    });

    //Ecouteur d'venements pour les boutons de contraste
    contrastPlusBtn.addEventListener('click', function(){
        contrast = contrast + 50;
        image.style.filter = `contrast(${contrast}%)`;
    });
    contrastMoinsBtn.addEventListener('click', function(){
        contrast = contrast - 50;
        image.style.filter = `contrast(${contrast}%)`;
    });

    //Tous les filtres sont enlevs de l'image
    initializeBtn.addEventListener('click', function(){
        image.style.removeProperty('filter');
        zoomScale = 1;
        //image.style.scale = zoomScale;
        image.style.cssText = "transform : scale("+ zoomScale +"); "
    })
}
