//Rcupre le data lorsqu'il reoit un message
ws.addEventListener('message',function(event){
    parsed = JSON.parse(event.data);
    switch (parsed.header){
        case "REQUEST_CLIENT_ID":
            uid = String(parsed.clientId);

            getImg = JSON.stringify({
                clientId: uid,
                base64File: null,
                checksum: "0333ff8c224366dac05ba154f2c6e4d9",
                isLaunchOrthoRect: false,
                fileName: "070992.tif",
                overWrite: false,
                header: "OPEN_IMAGE",
            });

            ws.send(getImg);
                break;
        case "OPEN_IMAGE_RESPONSE":

            console.log(parsed.status);

            //En fonction du statut de la requete
            switch(parsed.status){
                case "FS_IO_EXCEPTION":
                    getImg = JSON.stringify({
                        clientId: uid,
                        base64File: null,
                        checksum: "0333ff8c224366dac05ba154f2c6e4d9",
                        isLaunchOrthoRect: false,
                        fileName: "070992.tif",
                        overWrite: false,
                        header: "OPEN_IMAGE",
                    });

                    ws.send(getImg);
                    break;
                case "TO_UP_LOAD":
                    getImg = JSON.stringify({
                        clientId: uid,
                        base64File: base64String,
                        checksum: "0333ff8c224366dac05ba154f2c6e4d9",
                        isLaunchOrthoRect: false,
                        fileName: "070992.tif",
                        overWrite: false,
                        header: "OPEN_IMAGE",
                    });

                    ws.send(getImg);
                    break;
                case "IMAGE_DUPLICATED":
                    getImg = JSON.stringify({
                        clientId: uid,
                        base64File: base64String,
                        checksum: "0333ff8c224366dac05ba154f2c6e4d9",
                        isLaunchOrthoRect: false,
                        fileName: "070992.tif",
                        overWrite: true,
                        header: "OPEN_IMAGE",
                    });

                    ws.send(getImg);
                    break;
                case "UP_LOAD_SUCCESS":
                    getImg = JSON.stringify({
                        idMessage: parsed.clientId,
                        doRescale: false,
                        clientId: uid,
                        header: "GET_IMAGE_INTERFACE"
                    });
                    ws.send(getImg);
                    break;
                case "EXISTENT_IMAGE":
                    getImg = JSON.stringify({
                        idMessage: parsed.clientId,
                        doRescale: false,
                        clientId: uid,
                        header: "GET_IMAGE_INTERFACE"
                    });
                    ws.send(getImg);
                break;
                default:
                    break;
            }
                break;
        case "IMAGE_INTERFACE":
            getImg = JSON.stringify({
                idMessage: parsed.clientId,
                clientId: uid,
                doRescale: false,
                header: "GET_BUFFER_IMAGE"
            });

            ws.send(getImg);
                break;
        case "BUFFERED_IMAGE":
            base64String;
            afficheZoomImg();
            getImg = JSON.stringify({
                idImage: '',
                clientId: uid,
                doRescale: false,
                header: "CREATE_DATA_IMAGE"
            });

            ws.send(getImg);
                break;
        case "DATA_IMAGE":
            getImg = JSON.stringify({
                clientId: uid,
                images : "",
                mask : "",
                samplingMethod : "",
                paramSamplingMethode : "",
                idPercentage : "",
                nameData : "",
                header: "GET_DATA_INTERFACE_BY_ID"
            })
            ws.send(getImg);
            break;
        case "DATA_INTERFACE":
            getImg = JSON.stringify({
                id: '',
                clientId: uid,
                header: "CREATE_CLASSIFICATION"
            });

            ws.send(getImg);
            break;
        case "CLASSIFICATION_RESPONSE_CODE":
            getImg = JSON.stringify({
                idData: '',
                classification: '',
                clientId: uid,
                header: "GET_FINISH"
            });

            ws.send(getImg);
            break;
        case "FINISH_RESULT":
            getImg = JSON.stringify({
                finish: '',
                clientId: uid,
                header: "GET_RESULT_CLASSIFICATION"
            });

            ws.send(getImg);
            break;
        case "RESULT_CLASSIFICATION":
            getImg = JSON.stringify({
                idClassif: '',
                clientId: uid,
                header: "GET_BUFFER_IMAGE"
            });

            ws.send(getImg);
            break;
        //BUFFERED_IMAGE
        case "ROOT_CLASSIFICATION":
            getImg = JSON.stringify({
                idClassif: '',
                clientId: uid,
                header: "GET_MATRICE"
            });

            ws.send(getImg);
            break;
        case "MATRICE":
            getImg = JSON.stringify({
                idClassification: '',
                type: '',
                nbObject: '',
                clientId: uid,
                header: "GET_SCALING"
            });

            ws.send(getImg);
            break;
        case "SCALING":
            getImg = JSON.stringify({
                idClassification: '',
                method: '',
                type: '',
                dim: '',
                nbObject: '',
                clientId: uid,
            });

            ws.send(getImg);
            break;
        default:
            break;
    }
});


