//Data table
function getRandomInt(max) {
    return Math.floor(Math.random() * max);
}
if(dataTable){
    for(let i = 0; i < 255; i++){
        let tr = document.createElement('tr');
        dataTable.appendChild(tr);
        for(let j = 0; j < 4; j++){
            let td = document.createElement('td');
            if(j === 0){
                td.textContent = i;
            }else{
                td.textContent = getRandomInt(255);
            }

            tr.appendChild(td);
        }
    }
}

